import React from "react";


const x = [
  {
    name: 'maninder',
    age: '20',
    work: 'programmer'
  },
  {name:'ramanpreet',age:'19',work:'teacher'},
  {name:'gagan',age:'20',work:'music producer'},
  {name:'prabhdeep',age:'18',work:'enterpreneur'}
]

function k(){
  return (
    <>
      <h1>hi</h1>
    </>
  )
}

function Just(data) {
  return (
    <>
      <h1>My Name is </h1>
      <h2>My age is</h2>
      <p>I'm</p>
    </>
  );
}

function App(){
  return x.map( (val) => <Just name={val.name} age={val.age} work={val.work} />)
}

export default Just;
export {x, App, k};
